import React, { Component } from 'react';
import './App.css';

class Blog extends Component{

  render(){
    return (
      <div className="col-3">
        <div className="card">
          <div className="card-body">

            <p>
              { this.props.content }
            </p>
          </div>
        </div>
      </div>
    )
  }
}


function App() {
  return (
    <div className="App">
      <div className="container py-5">
        <div className="row">

          <Blog tieuDe="This is blog one!" content="This is content of blog one!" linkAnh="https://media.ngoisao.vn/news/2015/09/06/canh-canh-nam-than-showbiz-1resize-ngoisao.vn.stamp2.jpg" />


        </div>
      </div>
    </div>
  );
}

export default App;
